import React, {Component} from 'react';

import './Welcome.css';
import Play from './play.json';

function Welcome(){
    return(
    <div className = 'Welcome'>
        <div className = 'Welcome'>
        {Play.map(assets =>{
        return(
        <>
    <p>{assets.filename}</p>
        </>
    )
        
        })
        }
        
        
        </div>
        
        </div>
    )
    
    
}

export default Welcome;
